friends.summary:
Rachel freaks when Ross talks about spending a lifetime together; 
Chandler and Joey befriend Richard; Phoebe is shocked by the ending of 
"Old Yeller."

Monica orders a bed from the store owned by Janice's estranged husband; 
Joey teaches soap-opera acting; Ross struggles through a dinner with 
Rachel's abrasive father.

Phoebe's quest to find her father leads the gang to a beach house -- and 
leads Phoebe to a fateful meeting with an old family friend;
 Rachel persuades Bonnie to make a change.

Monica hires Joey so she can fire him to show who's the boss at the 
restaurant; Ross goes extra miles to date a gal from Poughkeepsie; 
Chandler plays matchmaker for Rachel.
